sys_variable_value.value:
(function parse(inputs, outputs) {
    try{
        var item  = JSON.parse(inputs.sourceItem);
        if(!item){
            gs.info('Script Parser Step: item = '+ inputs.sourceItem);
            //gs.eventQueue('eventname',null,'','');//trigger email
            outputs.state = 'SKIP';
        }else{
            outputs.targetObject.c_name = item.names[0].displayName;
            if (item.phoneNumbers)
                outputs.targetObject.c_phone = item.phoneNumbers[0].value;
            else
                outputs.targetObject.c_phone = "NA";
            if (item.emailAddresses)
                outputs.targetObject.c_email = item.emailAddresses[0].value;
            else
                outputs.targetObject.c_email = "NA";
        }
    } catch (e){
        gs.error('Script parser error: '+ e.message);
        outputs.state= 'SKIP';
    }
// Source item string is available in inputs.sourceItem.
// Generate output by setting fields of outputs.targetObject.
// 
// The structure of outputs.targetObject corresponds to the
// structure defined in the Data Stream Action output.
// 
// Optionally skip an item in the stream by setting
// outputs.state = 'SKIP'
//
// JSON Example:
// var item = JSON.parse(inputs.sourceItem);
// outputs.targetObject.ffName = item.firstName;
// outputs.targetObject.llName = item.lastName;
// outputs.targetObject.address.home.city = item.address.home.city;

})(inputs, outputs);

(function paginate(variables, pageResponse) {
    //Change the limit above to configure results per page.
    if(variables.nextPageToken){
        variables.getNextPage = true;
    }else{
        variables.getNextPage = false;
    }
    
})(variables, pageResponse);

